import React from "react";
import { Link } from "react-router-dom";
import artbashThumb from '../../assets/artbash/poster-1main.png';
import './work.scss';

const Work = () => {
    return (
        <div className='work'>
            <Link>
                <div className='thumbnail'>
                    <img />
                </div>
            </Link>
        </div>
    );
};

export default Work;
